webpackJsonp([0xe995915ef19b],{405:function(e,t){e.exports={data:{site:{siteMetadata:{title:"math lizard",author:"Elizabeth Keleshian"}},markdownRemark:{id:"/home/mathlizard/myblog/ekeleshian.github.io/src/pages/new-beginnings/index.md absPath of file >>> MarkdownRemark",html:'<p>I entered my late twenties questioning everything… </p>\n<p>Moving to SF in 2016 caused some major turn arounds in my life.\nVarious factors led from one thing to the next, causing a sequence of events that\nwere so atypical compared to my prior way of life.  I can almost describe\nmy chain of events as spontaneous in a way; life has felt fast and exciting.\nBut with this spontaneity nature comes also a determined\nside. Paradoxical, indeed, but the truth will always\nhold that I have a deep affinity for math, especially statistics.\nMy dream has always been to find work where my math knowledge\nputs me in an advantage and generates results that are impactful.<br>\nTeaching middle school math somehow didn’t cut it.</p>\n<p>2016-2017 indeed has been an era of epiphanies.  Many realizations\nwere made that became game-changers in my life - one\nbeing that I did not want to continue teaching.  Something very deep\nin my instincts, a feeling that is too internal to describe in words,\ncould explain why teaching is ultimately not for me. This blog is not intended\nto pour out those feelings.  This blog is just a representation of my\njournal describing my progress as a <a href="https://en.wikipedia.org/wiki/Newbie">n00b</a>\nin data science.  </p>',frontmatter:{title:"From Math Teacher to Data Science n00b",date:"June 10, 2018"}}},pathContext:{slug:"/new-beginnings/",previous:null,next:{fields:{slug:"/cleaning-up-data/"},frontmatter:{title:"Early Phases of Financial Literacy Project"}}}}}});
